window.bookSummaryJSON = "<p>Conryu has his life all figured out.</p> <p>At least until the final day of school arrives and with it the annual wizard's test.</p> <p>When Conryu passes the test, no one can believe it since everyone knows boys can't do magic.</p> <p>Suddenly thrust into a world of magic and danger, Conryu must figure out how to use his news powers and quickly.</p> <p>He soon finds himself on the run from a mad religious cult and hunted by a group of wizards that view a man wielding magic as the worst abomination imaginable. When his home city is taken hostage by the sinister Lady Raven, Conryu is the only one that can save the day.</p> <p>Can Conryu master his magic before it's too late?</p>"; 
